const PlanetAPI = async () => {
  try {
    const response = await fetch('https://swapi-trybe.herokuapp.com/api/planets/');
    const data = await response.json();
    return data;
    //   console.log(data);
  } catch (error) {
    return error;
  }
};

export default PlanetAPI;
